		<img src='./public/static/platzi-logo.png' alt='Platzi'/>

		<style jsx>{`
			h1 {
				color: red;
			}
			p {
				color: green;
			}
			img {
				max-width: 50%;
				display: block;
				margin: 0 auto;
			}
		`}</style>

		</div>
	}
}
